class AppUrl {
    static BaseUrl='http://127.0.0.1:8000';
    static visitorDetails = this.BaseUrl
    static HomeTitles=this.BaseUrl+'/homeTitles';
    static TechDesc=this.BaseUrl+'/techDescription';
    static TotalProjectClient=this.BaseUrl+'/projectClient';
    static VideoHome=this.BaseUrl+'/video';
    static ProjectDetails=this.BaseUrl+'/projectDetails/';
    static ProjectAll=this.BaseUrl+'/projects';
    static ProjectHome=this.BaseUrl+'/projectHome';
    static Services=this.BaseUrl+'/serviceData';
    static Footer=this.BaseUrl+'/footerData';
    static CourseDetails=this.BaseUrl+'/courseDetails/';
    static CourseAll=this.BaseUrl+'/courseAll';
    static CourseHome=this.BaseUrl+'/courseHome';
    static ContactSend=this.BaseUrl+'/contactSend';
    static ClientReview=this.BaseUrl+'/clientReview';
    static ChartData=this.BaseUrl+'/chartData';
    static Information=this.BaseUrl+'/informations';
}

export default AppUrl;
